import React from 'react'
import { Article } from '../../components'

const uniqueArticle = [...new Set(
    Article.map((newArt) =>{
      return newArt.id;
    })
)]

export const Articles = () => {
  return (
    <Blog passedArticle={uniqueArticle}/>
  )
}
